function Book(props){
return (
    <div className="card">
        <img src={props.image} width="150" height="150" alt="book"/>
        <h4>Price:{props.price}</h4>
    </div>
)
}
const books=[{image: "data:image/jpeg;base64,",price: 345},
    {image: "data:image/jpeg;base64,",price: 145},
    {image: "data:image/jpeg;base64,",price: 245}
]
function App(){
    return (
        <div className="book-list">
        {
            books.map(b=>(
                <Book image={b.image} price={b.price}/> 
            ))
        }
        </div>
    )
}
const parent=document.getElementById("root");
const root=ReactDOM.createRoot(parent);
root.render(<App/>);    